import React from 'react';

const Header =()=>{
  <ul class="nav justify-content-end">
<li class="nav-item">
  <a class="nav-link active" aria-current="page" href="#">Active</a>
</li>
<li class="nav-item">
  <a class="nav-link" href="#">Link</a>
</li>
<li class="nav-item">
  <a class="nav-link" href="#">Link</a>
</li>
<li class="nav-item">
  <a class="nav-link disabled">Disabled</a>
</li>
</ul>
}

